  public static int lengthOfLongestSubstring1(String s) {
    // 记录字符上一次出现的位置
    int[] last = new int[128];
    for (int i = 0; i < 128; i++) {
      last[i] = -1;
    }
    int n = s.length();

    int res = 0;
    int start = 0; // 窗口开始位置
    for (int i = 0; i < n; i++) {
      int index = s.charAt(i);
      start = Math.max(start, last[index] + 1);
      res = Math.max(res, i - start + 1);
      last[index] = i;
    }

    return res;
  }

  public static int lengthOfLongestSubstring(String s) {
    if (s == null || s.length() == 0) {
      return 0;
    }
    int n = diffStringSize(s);
    for (int k = n; k > 1; k--) {
      for (int i = 0; i <= s.length() - k; i++) {
        if (isNotRepeat(s.substring(i, i + k))) {
          return k;
        }
      }
    }
    return 1;

  }

  private static boolean isNotRepeat(String chars) {
    if (diffStringSize(chars) == chars.length()) {
      return true;
    }
    return false;
  }

  private static int diffStringSize(String chars) {
    HashMap<Character, Integer> map = new HashMap<>();
    for (int i = 0; i < chars.length(); i++) {
      map.put(chars.charAt(i), i);
    }
    return map.size();
  }

  public static int lengthOfLongestSubstring2(String s) {
    if (s == null || s.length() == 0) {
      return 0;
    }
    int n = 1;
    return findAns(n, s);
  }

  private static int findAns(int n, String chars) {
    if (isNotRepeat2(n, chars)) {
      n++;
      return findAns(n, chars);
    } else {
      return n - 1;
    }
  }

  private static boolean isNotRepeat2(int n, String chars) {
    for (int i = 0; i <= chars.length() - n; i++) {
      if (isNotRepeat(chars.substring(i, i + n))) {
        return true;
      }
    }
    return false;
  }
